import React from "react";
import "./Leaders.css";
import Datawrap from "./Datawrap";

export default class Leaders extends React.Component{
	render(){
	return(
		<div className="wrapper">
			<header>
				<h2>The Winners</h2>
				<p>Check out the winners from the pandemic</p>
			</header>
			<section>
				<Datawrap/>
			</section>
		</div>
		);
}
}
